import React, { useState } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faGlobe } from '@fortawesome/free-solid-svg-icons';
import './navbar.css';

function Navbar() {
  const [isOpen, setIsOpen] = useState(false); // State to toggle navbar visibility

  // Function to toggle the menu
  const toggleMenu = () => {
    setIsOpen((prev) => !prev);
  };

  return (
    <nav className="navbar">
      {/* Header Section (Logo) */}
      <div className="navbar-header">
        <div className="navbar-logo">
          <h1>Business Solution</h1>
        </div>
        {/* Hamburger menu icon, only shows on mobile */}
        <div className="navbar-hamburger" onClick={toggleMenu}>
          <FontAwesomeIcon icon={faBars} />
        </div>
      </div>

      {/* Navbar1 (Right aligned) */}
      {isOpen && (
        <div className="navbar1">
          <ul className="navbar-menu">
            <li>Driver</li>
            <li>Rider</li>
            <li>Business</li>
            <li>Log in</li>
            <li>Sign up</li>
            <li><FontAwesomeIcon icon={faGlobe} /> En</li>
          </ul>
        </div>
      )}

      {/* Navbar2 displayed below Navbar1 */}
      <div className="navbar2">
        <ul className="navbar-menu2">
          <li>Products</li>
          <li>Solutions</li>
          <li>Customers</li>
          <li>Resources</li>
          <li>Contact us</li>
          <li>Get started</li>
        </ul>
      </div>
    </nav>
  );
}

export default Navbar;
